import React from 'react';

const List = ({ list }) => {
    return (
        <div style={{
            textAlign: 'left',
            border: '2px solid black',
            width: '380px',
            marginLeft: '15px',
            marginTop: '20%', 
            paddingLeft: '10px',
        }}>
            {list && (
                <ul style={{ listStyle: 'none' }}>
                    {list.map(e => (
                        <li>{e}</li>
                    ))}
                </ul>
            )}
        </div>
    )
}

export default List;
